import React, {useState, useEffect} from 'react'
import axios from 'axios'
import Zimmer from './requirements/zimmer'
import BuchenControler from './BuchenControler'


const port = 5001;
const SuchAusgabe = () => {
  const [standOrte, setStandOrte] = useState([])
  const [sitzungsZimmer, setSitzungsZimmer] = useState([])

  useEffect(() => {
    axios.get(`http://localhost:${port}/standorte/`).then((response) => {
     setStandOrte(response.data)
    })
  }, [])
  useEffect(() => {
    axios.get(`http://localhost:${port}/sitzungszimmer/`).then((response) => {
      setSitzungsZimmer(response.data)   
    })
  }, [])

  function showPopup() {
    <div>{sitzungsZimmer.map( zimmer => <BuchenControler zimmername={zimmer.zimmerName}/>)}</div>
  }

  return <div className='Such-Ausgabe'>
    <div className='standort-test'>
      <div onClick={('')} className='sitzungsZimmer'>{sitzungsZimmer.map( zimmer => <Zimmer zimmername={zimmer.zimmerName} standort={zimmer.standortName} stockwerk={zimmer.stockwerk} maxP={zimmer.maxPersonen} />)}{
        <button className='test1'></button>
      });</div>
    </div>
  </div>;
};

console.log(Zimmer)

export default SuchAusgabe;
